function [x1, x2, y1, y2] = myDD2SRF_v1(tau, fd, h, gamma, Vt, Vr, lambda)

%myDD2SRF   computes the spatial coordinates of the delay-Doppler cell in
% the local scattering reference frame as defined in Marchan-Hernandez, J.F., 
% et al. (2009). An Efficient Algorithm to the Simulation of Delay–Doppler 
% Maps of Reflected Global Navigation Satellite System Signals. IEEE 
% Transactions on Geoscience and Remote Sensing, 47, 2733-2740.
%
% Input parameters:
%   - tau           Delay coordinate with respect the specular point delay [meter]
%   - fd            Doppler shift coordinate [hertz]
%   - h             Receiver height over the flat Earth surface [meter]
%   - gamma         Transmitter elevation [radian]
%   - Vt            Transmitter velocity in the SRF
%   - Vr            Receiver velocity in the SRF 
%   - lambda        Operating wavelength [meter]
% 
% Output parameters:
%   - x1            x-coordinate of the first solution
%   - x2            x-coordinate of the second solution
%   - y1            y-coordinate of the first solution
%   - y2            y-coordinate of the second solution
%  
% Children functions:
%   - myDD2SRF_flat(tau, fd, h, gamma, Vt, Vr, lambda);
%   - myDD2SRF_spherical(tau, fd, h, gamma, Vt, Vr, lambda, z_1, z_2)
%
% Author:
%   Alessio Di Simone <alessio.disimone@unina.it>
%
% Example:
% DD2SRF_test.m

Re = 6371e3;

[x0_1, x0_2, y0_1, y0_2] = myDD2SRF_flat(tau, fd, h, gamma, Vt, Vr, lambda);

z1_old = sqrt(Re^2 - x0_1^2 - y0_1^2) - Re;
z2_old = sqrt(Re^2 - x0_2^2 - y0_2^2) - Re;

r1_old = [x0_1, y0_1, z1_old];
r2_old = [x0_2, y0_2, z2_old];

rel_err_z1 = inf;
rel_err_z2 = inf;
iter = 1;
max_num_iter = 100;
step_tol = 0.1;

while iter < max_num_iter && max(rel_err_z1,rel_err_z2) > 0.01 %max(norm(diff_1), norm(diff_2)) > step_tol 
    [x1_new, x2_new, y1_new, y2_new] = myDD2SRF_spherical(tau, fd, h, gamma, Vt, Vr, lambda, r1_old(3), r2_old(3));
    
    z1_new = sqrt(Re^2 - x1_new^2 - y1_new^2) - Re;
    z2_new = sqrt(Re^2 - x2_new^2 - y2_new^2) - Re;
    rel_err_z1 = abs(z1_new - z1_old)/abs(z1_old);
    rel_err_z2 = abs(z2_new - z2_old)/abs(z2_old);
    r1_new = [x1_new, y1_new, z1_new];
    r2_new = [x2_new, y2_new, z2_new];
    r1_old = r1_new;
    r2_old = r2_new;
    z1_old = z1_new;
    z2_old = z2_new;
    iter = iter + 1;
end

x1 = x1_new;
x2 = x2_new;
y1 = y1_new;
y2 = y2_new;

end

