*cos(gamma)^2*sin(gamma)^3*tan(gamma)^2)^2) - (Vr_x^2*h^2*tan(gamma)^2 + Vr_y^2*h^2*tan(gamma)^2 + Vr_x^2*h^2*cos(gamma)^2*sin(gamma)^2 + Vr_y^2*h^2*cos(gamma)^2*sin(gamma)^2 + Vr_x^2*tau^2*sin(gamma)^2*tan(gamma)^2 + Vr_y^2*tau^2*sin(gamma)^2*tan(gamma)^2 + 2*Vr_x^2*h*tau*sin(gamma)*tan(gamma)^2 + 2*Vr_y^2*h*tau*sin(gamma)*tan(gamma)^2 - 2*Vr_x^2*h^2*cos(gamma)*sin(gamma)*tan(gamma) - 2*Vr_y^2*h^2*cos(gamma)*sin(gamma)*tan(gamma) + Vr_x^2*h^2*cos(gamma)^2*sin(gamma)^2*tan(gamma)^2 + Vr_z^2*h^2*cos(gamma)^2*sin(gamma)^2*tan(gamma)^2 - 2*Vr_y*Vr_z*h^2*cos(gamma)^2*sin(gamma)^2*tan(gamma) + 2*Vr_y*Vr_z*h^2*cos(gamma)*sin(gamma)*tan(gamma)^2 - 2*Vr_x^2*h*tau*cos(gamma)*sin(gamma)^2*tan(gamma) - 2*Vr_y^2*h*tau*cos(gamma)*sin(gamma)^2*tan(gamma) + 2*Vr_y*Vr_z*h*tau*cos(gamma)*sin(gamma)^2*tan(gamma)^2)/(Vr_x^2*sin(gamma)^2*tan(gamma)^2 + Vr_y^2*sin(gamma)^2*tan(gamma)^2 - Vr_x^2*cos(gamma)^2*sin(gamma)^2*tan(gamma)^2 + Vt_y^2*cos(gamma)^4*sin(gamma)^2*tan(gamma)^2 + Vt_z^2*cos(gamma)^2*sin(gamma)^4*tan(gamma)^2 - 2*Vr_y*Vt_z*cos(gamma)*sin(gamma)^3*tan(gamma)^2 + fd^2*lambda^2*cos(gamma)^2*sin(gamma)^2*tan(gamma)^2 - 2*Vr_y*Vt_y*cos(gamma)^2*sin(gamma)^2*tan(gamma)^2 + 2*Vt_y*Vt_z*cos(gamma)^3*sin(gamma)^3*tan(gamma)^2 + 2*Vt_y*fd*lambda*cos(gamma)^3*sin(gamma)^2*tan(gamma)^2 + 2*Vt_z*fd*lambda*cos(gamma)^2*sin(gamma)^3*tan(gamma)^2 - 2*Vr_y*fd*lambda*cos(gamma)*sin(gamma)^2*tan(gamma)^2))^(1/2) + Vr_y^2*sin(gamma)*tan(gamma)*((2*Vr_x^2*h*cos(gamma)*sin(gamma)^2*tan(gamma) - 2*Vr_y^2*h*sin(gamma)*tan(gamma)^2 - 2*Vr_x^2*tau*sin(gamma)^2*tan(gamma)^2 - 2*Vr_y^2*tau*sin(gamma)^2*tan(gamma)^2 - 2*Vr_x^2*h*sin(gamma)*tan(gamma)^2 + 2*Vr_y^2*h*cos(gamma)*sin(gamma)^2*tan(gamma) + 2*Vr_z*Vt_y*h*cos(gamma)^3*sin(gamma)^2*tan(gamma)^2 + 2*Vr_z*Vt_z*h*cos(gamma)^2*sin(gamma)^3*tan(gamma)^2 + 2*Vr_y*Vt_y*tau*cos(gamma)^2*sin(gamma)^2*tan(gamma)^2 - 2*Vr_y*Vr_z*h*cos(gamma)*sin(gamma)^2*tan(gamma)^2 + 2*Vr_y*Vt_y*h*cos(gamma)^2*sin(gamma)*tan(gamma)^2 - 2*Vr_y*Vt_y*h*cos(gamma)^3*s